import React, { useState } from "react";
import axios from "axios";
import { Link, useNavigate } from "react-router-dom";

const Register = () => {
  const [firstname, setFirstname] = useState("");
  const [lastname, setLastname] = useState("");
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [role, setRole] = useState("");

  console.log(firstname, lastname, username, email, role, password);

  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    // console.log("called", username, password);

    try {
      const response = await axios.post("http://localhost:3001/auth/register", {
        firstname,
        lastname,
        username,
        email,
        role,
        password,
      });
      alert("registration successful!");

      console.log("responce", response);
      navigate("/login");
      // alert("registration successful!");
    } catch (error) {
      console.log("error", error);
    }
    setUsername("");
    setPassword("");
    setEmail("");
    setFirstname("");
    setLastname("");
    setRole("");
  };

  return (
    <section class="vh-100 gradient-custom">
      <div class="container py-5 h-100">
        <div class="row justify-content-center align-items-center h-100">
          <div class="col-12 col-lg-9 col-xl-7">
            <div
              class="card shadow-2-strong card-registration"
              style={{ borderRadius: "15px" }}
            >
              <div class="card-body p-4 p-md-5">
                <h3 class="mb-4 pb-2 pb-md-0 mb-md-5">Registration Form</h3>
                <form onSubmit={handleSubmit}>
                  {/* <h1 className="text-center">Register Here</h1> */}
                  <div class="row">
                    <div class="col-md-6 mb-4">
                      <div className="form-outline">
                        <lable className="form-label">firstname</lable>
                        <input
                          type="firstname"
                          placeholder="firstname"
                          name="firstname"
                          value={firstname}
                          onChange={(e) => setFirstname(e.target.value)}
                          className="form-control"
                        />
                      </div>
                    </div>
                    <div class="col-md-6 mb-4">
                      <div className="form-outline">
                        <lable className="form-label">lastname</lable>
                        <input
                          type="lastname"
                          placeholder="lastname"
                          name="lastname"
                          value={lastname}
                          onChange={(e) => setLastname(e.target.value)}
                          className="form-control"
                        />
                      </div>
                    </div>
                  </div>
                  <div class="row">
                    <div class="col-md-6 mb-4">
                      <div className="form-outline">
                      <lable className="form-label">Username</lable>
                        <input
                          placeholder="username"
                          name="username"
                          className="form-control"
                          value={username}
                          onChange={(e) => setUsername(e.target.value)}
                        />
                      </div>
                    </div>
                    <div class="col-md-6 mb-4">
                      <div className="form-outline">
                      <lable className="form-label">Email</lable>
                          <input
                            type="email"
                            placeholder="email"
                            name="email"
                            value={email}
                            onChange={(e) => setEmail(e.target.value)}
                            className="form-control"
                          />
                      </div>
                    </div>
                  </div>
                  <div class="row">
                    <div class="col-md-6 mb-4">
                      <div className="form-outline">
                      <lable className="form-label">Role</lable>
                    <select
                      onChange={(e) => setRole(e.target.value)}
                      className="form-select"
                    >
                      <option value="admin">Admin</option>
                      <option value="user">User</option>
                    </select>
                      </div>
                    </div>
                    <div class="col-md-6 mb-4">
                      <div className="form-outline">
                      <lable className="form-label">Password</lable>
                    <input
                      type="password"
                      placeholder="password"
                      name="password"
                      value={password}
                      onChange={(e) => setPassword(e.target.value)}
                      className="form-control"
                    />
                      </div>
                    </div>
                  </div>
                  
                  <div className="mb-1 mt-3">
                   
                  </div>
                  <div className="mb-1 mt-3">
                    
                  </div>
                  <div className="text-center mt-3">
                    <button type="submit" className="btn btn-primary">
                      {" "}
                      Submit
                    </button>
                  </div>
                </form>
              </div>

              <span>
                If you are alredy registered!{" "}
                <Link to="/login">Click here for Login</Link>
              </span>
            </div>
            <div className="col-lg-3"></div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Register;
